12446.extract:
Sõnal "kirik" on eesti keeles mitu tähendust:

kirik ehk kristlik kirik on kristlike koguduste struktuuri üldnimetus;
kirik ehk pühakoda või hoone, kuhu kogudus jumalateenistuse pidamiseks koguneb.

65514.extract:
Jäätmekategooriad on:

Q1 – edaspidi teisiti määratlemata tootmis- ja tarbimisjäägid;
Q2 – praaktooted;
Q3 – tooted, mille kasutustähtaeg on lõppenud;
Q4 – materjalid, mis on maha voolanud, riknenud või mõne õnnetusjuhtumi tõttu kahjustunud, kaasa arvatud materjalid, seadmed või muud esemed, mis on õnnetusjuhtumi tagajärjel saastunud;
Q5 – materjalid, mis on saastunud või kõlbmatuks muutunud sihipärase tegevuse tagajärjel, nagu puhastusjäägid, pakkimismaterjalid, mahutid;
Q6 – kasutamiskõlbmatud päraldised, nagu tühjad patareid, kasutatud katalüsaatorid;
Q7 – ained, mis ei toimi enam nõutaval tasemel, nagu saastunud happed, lahustid, kasutatud karastussoolad;
Q8 – tööstusprotsessijäägid, nagu räbud, destillatsioonijäägid;
Q9 – saastetõrje- ja puhastusprotsessijäägid, nagu skraberisetted, kottfiltritolm, kasutatud filtrid;
Q10 – metallide töötlemise ja viimistlemise jäägid, nagu treilaastud, valtsimistagi;
Q11 – toorme kaevandamise ja töötlemise jäägid, nagu kaevandamisjäägid, naftatootmisel tekkinud muda;
Q12 – rikutud materjalid, nagu PCB-ga saastatud õli;
Q13 – kõik materjalid, ained või tooted, mille kasutamine on keelatud;
Q14 – tooted, millele valdaja ei leia edasist kasutamist, nagu põllumajanduses, olmes, kontorites, kauplustes või töökodades ära visatud vallasasjad;
Q15 – reostatud pinnase puhastamisel tekkinud saastunud materjalid, ained või tooted;
Q16 – kõik materjalid, ained või tooted, mida ei hõlma ülalloetletud kategooriad.

256750.extract:
Kruvi võib tähendada:

keermestatud silindrilist või koonilist varba asjade ühendamiseks (kruvi);
laeva sõukruvi, mis laeva edasi liigutab;
spordis ka keha spiraalset liikumist ümber pikitelje, näiteks vettehüpetes (kruvi (sport)).
